style.css:
/* Default (light mode) styles */
body {
    background-color: white;
    color: black;
}

/* Dark mode styles */
@media (prefers-color-scheme: dark) {
    body {
        background-color: black;
        color: white;
    }
}

/* You can also target other elements */
@media (prefers-color-scheme: dark) {
    header {
        background-color: #333;
    }
    
    nav {
        background-color: #444;
    }

    a {
        color: #1e90ff;
    }

    button {
        background-color: #555;
        color: white;
    }
}
